import React, { Component } from "react";
import '../css/App.css'
import '../css/clipart1087676.png'

export default class Header extends Component
{
    render()
    {
        return(
            <div className="header_main_container">
                <img src={require("../css/bottle2.png")}/>
            </div>

        )

    }
}
